import axios from 'axios'

const CAR_REST_API_URL = 'http://localhost:8080/car/cars';
const SHOW_CAR = 'http://localhost:8080/car/{id}';

class CarService {
    
    getCars() {
       return axios.get(CAR_REST_API_URL);
    }

    getCar() {
        return axios.get(SHOW_CAR);
    }
}

export default new CarService();
